import { useState, useEffect } from "react"

import SearchBar from "../components/Search"
import { useParams } from "react-router-dom";

const Browse = () => {

    const params = useParams();

    return (
        <>  
            <SearchBar/>
            <h1>HELLO {params.recipient}</h1>
        </>
    )

}

export default Browse
